webpackJsonp([0x77767ff6d0a2],{7686:function(e,a){e.exports={data:{post:{html:'<p>On this weblog I missed our wedding anniversary on the 6th, that day 23 years ago when we were still <a href="http://www.papascott.de/archives/2002/09/09/young-dumb-and-excited/">young, dumb and excited</a>. Here I tend to <a href="http://www.papascott.de/archives/2004/09/06/">forget</a> our anniversary as often as I <a href="http://www.papascott.de/archives/2005/09/06/twenty-two-years/">remember</a>. We didn\'t forget it in real life though. On Wednesday morning MamaMaus and I managed to exchange a couple of heartfelt SMS messages.</p>',fields:{title:"23rd Anniversary",date:"10 Sep 2006",url:"https://papascott.de/2006-09-10-23rd-anniversary/"}}},pathContext:{slug:"/2006-09-10-23rd-anniversary/",prev:{fields:{title:"Grade School Week One",date:"09 Sep 2006",slug:"/2006-09-09-grade-school-week-one/"}},next:{fields:{title:"Five Years",date:"10 Sep 2006",slug:"/2006-09-10-five-years/"}}}}}});
